import styles from '../../assets/css/styles';

export default class InventarioDetalle{
  render() {
    return (
      <View style={{flex: 1, alignItemsi: "center", justifyContent: "center"}}>
        <Text>Inventario</Text>
      </View>
    )
  }
}
